  false,\n\t\"url\": null,\n\t\"notes\": \"The Chicago Public Library has more than
  70 locations. The Chicago Public Library consists of the Harold Washington Library
  Center, Sulzer and Woodson regional libraries and over 70 neighborhood branches.
  Edgewater Branch reopened in a new, 2-story facility on 6/22/2013. Humboldt Park
  Branch closed 3/26/2012 for construction of a 5,000-square-foot addition; it reopened
  2/9/2013. Albany Park Branch closed 9/22/2012 for construction of a new branch expected
  to open in 2014. Interim services are being provided in the Albany Park community.
  Gage Park Branch closed 2/22/2013-3/1/2013 for full carpet replacement and South
  Shore Branch was closed from 5/13/2013-6/29/2013 for repairs and renovation. Many
  locations experience sporadic emergency closures due to heating or air conditioning
  issues, or area power outages.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
